    "Low-Cost, High-Performance Combustion Chamber for LOX/CH4 Propulsion, Phase II
    Project",nt"tracking_summary": {ntt"total": 22,ntt"recent": 0nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-05-07T00:50:39.149805",nt"name":
    "low-cost-high-performance-combustion-chamber-for-lox-ch4-propulsion-phase-ii-project",nt"isopen":
    true,nt"url": null,nt"notes": "In this project, Ultramet is designing and
    fabricating a lightweight, high temperature combustion chamber for use with cryogenic
    liquid oxygen/methane (LOX/CH4) propellant that will deliver a specific impulse
    of ~355 seconds, an increase over the current 320-sec baseline that will result
    in a propellant mass decrease of 55 lbm. The material system is based on Ultramet's
    proven oxide-iridium/rhenium architecture, which has been successfully hot-fire
    tested with stoichiometric oxygen/hydrogen for hours. Instead of rhenium, however,
    the structural material will be a niobium or tantalum alloy that has excellent yield
    strength at both ambient and elevated temperature. Phase I demonstrated alloys with
    yield strength-to-weight ratios more than three times that of rhenium, which will
    significantly reduce chamber weight. The starting materials are also two orders
    of magnitude less expensive than rhenium and are less expensive than the C103 niobium
    alloy commonly used in low-performance engines. Phase II will focus on the design,
    fabrication, and hot-fire testing of a small (5-25 lbf thrust class) chamber with
    LOX/CH4, and will culminate in the design and fabrication of a 100-lbf chamber that
    can be mated and tested with an existing LOX/CH4 injector. Throughout the project,
    Ultramet will work closely with Aerojet, which will perform the hot-fire testing.",nt"license_title":
